import React from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView} from 'react-native';
import {css} from '../assets/Css/css';

export default function Preditor2 ({route}) {
    const[result,setResult] = useState(route.params?.transf.data.val_fuzz)
    //console.log(result)
    return (
        <SafeAreaView style = {css.fundo}>
            <View> <Text>{result}</Text></View>
        </SafeAreaView>
    );
    
}
